import {Grid} from "@material-ui/core";
import '@axa-ch/input-text';
import {useState} from "react";

export default function Search() {

    const [appId, setAppId] = useState('');
    const [context, setContext] = useState('');
    const [textId, setTextId] = useState('');
    const [stage, setStage] = useState('');

    function reset() {
        setAppId('')
        setContext('')
        setTextId('')
        setStage('')
    }

    return (
        <Grid container direction={"row"} className={"searchContainer"}>
            <Grid item xs={2} className="searchInputField">
                <axa-input-text name={"APP-ID"}
                                label={'App-ID'}
                                value={appId}
                                className={"searchInputField"}
                />
            </Grid>

            <Grid item xs={2} className="searchInputField">
                <axa-input-text name={"CONTEXT"}
                                label={'Kontext'}
                                value={context}
                                className={"searchInputField"}
                />
            </Grid>
            <Grid item xs={2} className="searchInputField">
                <axa-input-text name={"TEXT_ID"}
                                label={'Text-ID'}
                                value={textId}
                                className={"searchInputField"}
                />
            </Grid>
            <Grid item xs={2} className="searchInputField">
                <axa-input-text name={"STAGE"}
                                label={'Stage'}
                                value={stage}
                                className={"searchInputField"}
                />
            </Grid>
            <Grid item xs={1} className="searchAndResetButton">
                <axa-button variant="contained" color="primary" id={"searchButton"}
                        name={'searchButton'}>
                    Suchen
                </axa-button>
            </Grid>
            <Grid item xs={1}>
                <axa-button variant="contained" color="inherit" id={"resetButton"} onClick={reset} name={'resetButton'}>
                    Reset
                </axa-button>
            </Grid>
        </Grid>
    );
}
